const axios = require('axios');

const getShopCategories = async () => {
    const result = await axios.get('http://localhost:1337/categories');
    result
    .then(resultData => console.log(resultData))
    .catch(err => {
      console.log(err)
    })
}

 exports.getShopCategories = getShopCategories;
